import React from 'react';
import { View, Text, TouchableOpacity } from 'react-native';

import styles from './styles';

const BottomButton = ({
  onPress,
  text,
  containerReplace,
  touchReplace,
  textReplace,
  container,
  touchStyle,
  textStyle,
}) => {
  return (
    <View style={containerReplace || [styles.container, container]}>
      <TouchableOpacity
        onPress={onPress}
        style={touchReplace || [styles.touch, touch]}
      >
        <Text style={textReplace || [styles.text, text]}>{text}</Text>
      </TouchableOpacity>
    </View>
  );
};

export default BottomButton;
